// App.js
import React from 'react';
import Register from './Register';
import Login from './Login';


const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Routes>
        <Route exact path='/' element={<Login/>}/>
        
        <Route path='/Newapp' element={<Newapp/>}/>
      </Routes>
      </BrowserRouter>
    
    </div>
  );
}

export default App;
